import React, {Fragment, Component} from "react";
import "./App.css";

class App extends Component {

  foo = () => 'Barss';
  render() {

    const name = 'John Doe';
    // const foo = () => 'Bar';

    const loading = true;

    if(loading){
      return <h4> Loading </h4>
    }

    return (
      <div className="App">
        {loading ? <h4> Loading...</h4> : <h1> Hello {name}</h1> }
        <h1>
          Hello {name}
        </h1>
        <h2>
          Carlos Vides
        </h2>

        <Fragment>
          This does not have a div around it


        </Fragment>
      </div>

    );
  }
}
export default App;
